import Ava from './Ava';
import {background} from '../Styles/Background.module.scss';


class Background extends Component{
    render(){
        return(
            <Fragment>
                <div>
                    <h1>background&avatar</h1>
                </div>
                <Ava /> 
            </Fragment>           
        );

    }
    
}

export default Background;
